import React from 'react';

export default function Main() {
  return (
    <>
    <div style={{position:"absolute",top:"80px",left:"80px"}}>
      <img src="collage1.jpg" alt="error" height="600px" width="600px" ></img>
    </div>
    <div className='container camera' style={{height:"335px",width:"335px",display:"flex",justifyContent:"center",borderRadius:"50%",alignItems:"center",cursor:"pointer",marginTop:"150px",zIndex:"20"}}>
        <img src="camera12.jpg" alt="error" height="300px" width="300px" style={{borderRadius:"50%"}}  ></img>
    </div>
    </>
  )
}
